import React from 'react'
import Home from './Home'
import About from './About'
import{Route,BrowserRouter as Router,Switch,Link} from 'react-router-dom'
function App(){
  return(
    <div id="nav">
<a>HariCharan</a>
<Router>
<a><Link to='/Home'></Link>Home</a>
<a>About</a>
<a>Blog</a>
</Router>
</div>
  );
}
export default App;
